import { Component } from '@angular/core';
import { FormBuilder, FormGroup, Validators } from '@angular/forms';
import { TelegramService } from '../../services/telegram.service';
import { DomSanitizer, SafeHtml } from '@angular/platform-browser';

@Component({
  selector: 'app-contacts',
  templateUrl: './contacts.component.html',
  styleUrls: ['./contacts.component.scss'],
})
export class ContactsComponent {
  contactForm!: FormGroup;
  isSending = false;
  errorMessage = '';
  showSuccessModal = false;
  danisSvg: SafeHtml;

  constructor(
    private fb: FormBuilder,
    private telegramService: TelegramService,
    private sanitizer: DomSanitizer
  ) {
    this.contactForm = this.fb.group({
      name: ['', [Validators.required, Validators.minLength(2)]],
      phone: [
        '+7',
        [
          Validators.required,
          Validators.pattern(/^\+7[0-9]{10}$/),
          Validators.minLength(12),
          Validators.maxLength(12),
        ],
      ],
      text: [''],
    });

    this.danisSvg = this.sanitizer
      .bypassSecurityTrustHtml(`<svg width="598" height="715" viewBox="0 0 598 715" fill="none" xmlns="http://www.w3.org/2000/svg" xmlns:xlink="http://www.w3.org/1999/xlink" class="Danis-photo-internal">
<rect width="598" height="715" fill="url(#pattern0_1181_1821)"/>
<defs>
<pattern id="pattern0_1181_1821" patternContentUnits="objectBoundingBox" width="1" height="1">
<use xlink:href="#image0_1181_1821" transform="matrix(0.000836121 0 0 0.000699301 -0.398829 -0.331469)"/>
</pattern>
<image id="image0_1181_1821" width="2355" height="2074" preserveAspectRatio="none" xlink:href="data:image/png;base64,"/>
</defs>
</svg>
`);
  }

  formatPhoneNumber(event: Event): void {
    const input = event.target as HTMLInputElement;
    let value = input.value.replace(/[^0-9]/g, '');

    if (!value.startsWith('7')) {
      value = '7' + value;
    }

    value = value.substring(0, 11);

    let formatted = '+7';
    if (value.length > 1) {
      formatted += ' (' + value.substring(1, 4);
    }
    if (value.length >= 4) {
      formatted += ') ' + value.substring(4, 7);
    }
    if (value.length >= 7) {
      formatted += '-' + value.substring(7, 9);
    }
    if (value.length >= 9) {
      formatted += '-' + value.substring(9, 11);
    }

    input.value = formatted;
    this.contactForm.get('phone')?.setValue('+7' + value.substring(1), {
      emitEvent: false,
    });
  }

  onSubmit() {
    if (this.contactForm.invalid) {
      this.markAllAsTouched();
      return;
    }

    this.isSending = true;
    this.errorMessage = '';
    this.showSuccessModal = false;

    this.telegramService.sendMessage(this.contactForm.value).subscribe({
      next: () => {
        this.showSuccessModal = true;
        this.contactForm.reset({ phone: '+7' });
      },
      error: (err) => {
        this.errorMessage = 'Ошибка отправки формы. Попробуйте позже.';
      },
      complete: () => {
        this.isSending = false;
      },
    });
  }

  private markAllAsTouched() {
    Object.values(this.contactForm.controls).forEach((control) => {
      control.markAsTouched();
    });
  }

  hideSuccessModal() {
    this.showSuccessModal = false;
  }
}
